★VIPカーセダンの定番スタイル！静電気を空中放電【アンテナアース】<br><br>極太アンテナアースです。<br>セダンのトランクに取り付けるトランクリッド取り付けタイプです。<BR><br>クラウン・セルシオ・シーマ・セドリック・グロリア・マーク2・クレスタなどに<br><br><br>■特長<br> ・車のボディに帯電している静電気を放電回路により空中放電し、<br> 静電気を減少させます<br> ・洗車時、アンテナロッドをジョイント部から簡単に取り外す事ができ、<br> 大変便利です<br> ・アンテナ先端部にブルーに光るLED付<br><br><br>■静電気減少の効果<br> ・車のボディに触れた時のピリッとする不快な感電を和らげます<br> （静電気が人体に帯電している場合は効果がありません）<br> ・車のボディへのホコリの付着を軽減させます<br> ・静電気によるラジオ、無線機等による雑音を軽減させます<br><br><br><style type="text/css">
